import React from 'react';
import {
  Layout, Modal, Tabs,
} from 'antd';
import { ReactComponent as LoginIcon } from '../../assets/001-login.svg';
import { ReactComponent as Resgister } from '../../assets/002-escalator.svg';
import SignIn from '../../components/sign-in/sign-in.component';
import SignUp from '../../components/sign-up/sign-up.component';

const { Content } = Layout;
const { TabPane } = Tabs;
function callback(key) {
  console.log(key);
}
const SignInSignUpPage = () => {
  const handleCancel = (e) => {
    console.log(e);
  };
  const handleOk = (e) => {
    console.log(e);
  };
  return (
    <>
      <Content style={{
        width: '1140px',
        display: 'flex',
        justifyContent: 'space-between',

        margin: '30px auto',
      }}
      >
        <Modal
          visible
          onOk={handleOk}
          onCancel={handleCancel}
        >
          <Tabs
            defaultActiveKey="1"
            onChange={callback}
            size="large"

            centered="true"
            addIcon={<Resgister style={{ width: '50px', height: '50px' }} />}
            tabBarGutter = {50}
          >
            <TabPane tab="Sign IN" key="1">
              <SignIn />
            </TabPane>
            <TabPane tab="Sign UP" key="2">
              <SignUp />
            </TabPane>
          </Tabs>
        </Modal>

      </Content>

    </>
  );
};

export default SignInSignUpPage;
